import React from 'react'
import { useSelector } from 'react-redux';

const CheckoutPlaceorder = () => {
    const state = useSelector((state) => state.controlItems);
    const {
        cart: { shippingAddress, paymentMethod },
    } = state;
    console.log(state);
    return (
        <div>
            <h1 className='mb-3 text-center'>Revisa tu orden</h1>
            <div className="row">
                <div className="col md-8">
                    <div className="card">
                        <div className=" card-body">
                            <h3 className=" card-title">Envío </h3>
                            <p className='card-text'>
                                <strong className='me-2'>Nombre:</strong>{ shippingAddress.fullName} <br/>
                                <strong className='me-2'>Rut:</strong>{ shippingAddress.rut} 
                                <strong className='me-2'>Teléfono:</strong>{ shippingAddress.phone} <br/>
                                <strong className='me-2'>Nombre:</strong>{ shippingAddress.fullName} <br/>

                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default CheckoutPlaceorder
